PROCEDURE Proc_Missionallowance_GetByFilter (IN p_LiMit int, IN p_OffSet int, IN p_MissionallowanceFilter varchar(100), IN p_StatusFilter int, IN p_MisaCodeFilter text)
BEGIN
  -- Câu lệnh lấy danh sách nhân viên theo phân trang và tìm kiếm --
  -- CreatedBy: Bien (15/03/2023 ) --
  SET @Keyword = CONCAT('%', p_MissionallowanceFilter, '%');
  SET @MisaCode = CONCAT(p_MisaCodeFilter, '%');

  CREATE TEMPORARY TABLE IF NOT EXISTS tbOrginal AS
  SELECT
    b.MissionallowanceId,
    b.EmployeeId,
    e.EmployeeCode,
    e.FullName,
    d.DepartmentId,
    e.PositionName,
    b.PositionId,
    d.DepartmentName,
    b.FromDate,
    b.RequestDate,
    b.ToDate,
    b.LeaveDay,
    b.Location,
    b.Purpose,
    b.Request,
    b.SupportIds,
    b.SupportNames,
    b.ApprovalIds,
    b.ApprovalNames,
    b.RelationShipIds,
    b.RelationShipNames,
    b.Notes,
    b.Status,
    d.MisaCode,
    b.EmployeeMissionAllowances,
    CASE WHEN b.Status = 0 THEN "Tất cả" WHEN b.Status = 1 THEN "Chờ duyệt" WHEN b.Status = 2 THEN "Đã duyệt" ELSE "Từ chối" END AS StatusName
  FROM missionallowances b
    LEFT JOIN employee e
      ON b.EmployeeId = e.EmployeeId
    LEFT JOIN department d
      ON b.DepartmentId = d.DepartmentId
  WHERE (e.FullName LIKE @Keyword
  OR e.EmployeeCode LIKE @Keyword
  OR p_MissionallowanceFilter = ''
  OR p_MissionallowanceFilter IS NULL
  )
  AND (b.Status = p_StatusFilter
