  OR p_StatusFilter IS NULL)
  AND (d.MisaCode LIKE @MisaCode
  OR p_MisaCodeFilter = ''
  OR p_MisaCodeFilter IS NULL)
  ORDER BY b.ModifiedDate DESC;

  SELECT
    *
  FROM tbOrginal po
  LIMIT p_LiMit OFFSET p_OffSet;

  SELECT
    COUNT(*)
  FROM tbOrginal po;

  DROP TEMPORARY TABLE IF EXISTS tbOrginal;
END
